import * as React from "react"
import {useForm} from "react-hook-form";

type formType = {
    username: string
    password: string
}

const Register = () => {
    
    const {register, handleSubmit, errors} = useForm<formType>();

    const onSubmit = handleSubmit((data: object) => {
        console.log(data);
    })

    return (
        <div>
            Register Page
            <form onSubmit={onSubmit}>
                <input type="text" ref={register} name="username" placeholder="Submit" />
                <input type="password" ref={register} name="password" placeholder="Password" />
                <button type='submit'>Submit </button>
            </form> 
        </div>
    )
}

export default Register;
